import axios from 'axios';

export const fetchCryptoData = async (selectedCrypto) => {
    try {
        const response = await axios.get(`http://localhost:8000/crypto/${crypto}`);
        return response.data;
    } catch (error) {
        console.error("Error fetching crypto data:", error);
        return null;
    }
};
